import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { DeliveryPeopleComponent } from './components/delivery-people/delivery-people.component';
import { ListComponent } from './components/list/list.component';
import { OrderComponent } from './components/order/order.component';
import {SignInComponent} from "./components/sign-in/sign-in.component";
import {HikesComponent} from "./components/hikes/hikes.component";

const routes: Routes = [
  { path: '', component: SignInComponent },
  { path: 'hikes', component: HikesComponent },
  { path: 'seznam', component: ListComponent },
  { path: 'dostavljalci', component: DeliveryPeopleComponent },
  { path: 'prijava', component: DeliveryPeopleComponent },
  { path: 'filter', component: DeliveryPeopleComponent },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
